import { Form, Field } from 'react-final-form'
import { useDispatch} from 'react-redux';
import { useHistory, useSelector } from "react-router-dom";
import { updateCredentials } from '../actions/updateCredentials'

const ChangePassword = () => {

    const dispatch = useDispatch();    
    const history = useHistory();

    const {id} = useSelector((state) => state.loggedUserReducer)

    // params.id}/${params.object}/change`,
    //     params: {
    //         oldCredential: params.oldCredential,
    //         oldCredentialReapeted: params.oldCredentialReapeted,
    //         newCredential:

    const onSubmit = values => {
      dispatch(updateCredentials({id: id, object: "password", oldCredential: values.oldPassword, oldCredential: values.newPassword, oldCredential: values.repeatNewPasswordReapeted}))
    }

    return (
        <Form
        onSubmit={onSubmit}
        initialValues={
            {

            }
        }
        render={({ handleSubmit, form, values }) => (
          <form 
            className="service-form-wrapper"
            onSubmit={handleSubmit}
          >
            <div className="form-header email-form-boundaries">
              CHANGE PASSWORD
            </div>
            <div className="formFieldsWrapper">
              <div className="formFieldWrapper">
                <label className="formLabel">OLD PASSWORD</label>
                <Field
                  name="oldPassword"

                  className="formTextInput" 
                  component="input"
                />
              </div>                   
              <div className="formFieldWrapper">
                <label className="formLabel">NEW PASSWORD</label>
                <Field
                  name="newPassword"

                  className="formTextInput" 
                  component="input"
                />
              </div>                     
              <div className="formFieldWrapper">
                <label className="formLabel">REPEAT NEW PASSWORD</label>
                <Field
                  name="repeatNewPasswordReapeted"

                  className="formTextInput" 
                  component="input"
                />
              </div>  
            </div>   

            <div className="formButtonsWrapper">
                <button
                    className="formButton formServiceButton"
                    type="button"
                    onClick={form.reset}
                >
                    RESET

                </button>
                <button
                    className="formButton formServiceButton"
                    type="button"
                >
                    CHANGE
                </button>

            </div>
          </form>
        )}
      />
    )


}
export default ChangePassword;
